import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Home from './components/common/Home';
import About from './components/common/About';
import Login from './components/common/Login';
import SignUp from './components/common/SignUp';

import Complaint from './components/user/Complaint';
import Status from './components/user/Status';
import HomePage from './components/user/HomePage';

import AdminHome from './components/admin/AdminHome';
import AgentInfo from './components/admin/AgentInfo';
import AdminDashboard from './components/admin/AdminDashboard';
import UserInfo from './components/admin/UserInfo';
import AccordionAdmin from './components/admin/AccordionAdmin';

import AgentHome from './components/agent/AgentHome';

import ChatWindow from './components/common/ChatWindow';
import FooterC from './components/common/FooterC';

import 'bootstrap/dist/css/bootstrap.min.css';

// ðŸ” Dummy Private Route setup (expand later with real auth)
const PrivateRoute = ({ children, role }) => {
  const userType = localStorage.getItem('userType'); // 'user', 'admin', 'agent'
  return userType === role ? children : <Navigate to="/login" />;
};

function App() {
  return (
    <div>
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />

        {/* User routes */}
        <Route
          path="/user/home"
          element={<PrivateRoute role="user"><HomePage /></PrivateRoute>}
        />
        <Route
          path="/user/complaint"
          element={<PrivateRoute role="user"><Complaint /></PrivateRoute>}
        />
        <Route
          path="/user/status"
          element={<PrivateRoute role="user"><Status /></PrivateRoute>}
        />

        {/* Admin routes */}
        <Route
          path="/admin/home"
          element={<PrivateRoute role="admin"><AdminHome /></PrivateRoute>}
        />
        <Route
          path="/admin/agents"
          element={<PrivateRoute role="admin"><AgentInfo /></PrivateRoute>}
        />
        <Route
          path="/admin/users"
          element={<PrivateRoute role="admin"><UserInfo /></PrivateRoute>}
        />
        <Route
          path="/admin/accordion"
          element={<PrivateRoute role="admin"><AccordionAdmin /></PrivateRoute>}
        />
        <Route
          path="/admin/dashboard"
          element={<PrivateRoute role="admin"><AdminDashboard /></PrivateRoute>}
        />

        {/* Agent routes */}
        <Route
          path="/agent/home"
          element={<PrivateRoute role="agent"><AgentHome /></PrivateRoute>}
        />

        {/* Common */}
        <Route path="/chat" element={<ChatWindow />} />
      </Routes>
      <FooterC />
    </div>
  );
}

export default App;
